#Wątły: Nadchodzi Nawrocki, Andrzeja Dudę będziemy wspominać jak niewinną zabawę w piaskownicy. To będzie Duda do potęgi n-tej. 
@ARozenek : Nie klei mi się przyspieszenie rządu w takich warunach, rządzenie ustawami będzie niemożliwe, wiele ważnych rzeczy nie uda się zrealizować. 
Nie składali ustaw, bo wszyscy czekali na naszego prezydenta Trzaskowskiego, który to wszystko podpisze..

